import React from 'react';
import TweetBox from './TweetBox';
import Post from './Post';
import './Feed.css';

function Feed() {
  const [posts, setPosts] = useState([])

  return (
    <div className='feed'>
      <div className='feed__header'>
        <h2>Home</h2>
      </div>
      <TweetBox />
      <Post 
      displayName='Jeff Lui' 
      username='tuckeroo' 
      verified 
      text='working'
        avatar='https://kajabi-storefronts-production.global.ssl.fastly.net/kajabi-storefronts-production/themes/284832/settings_images/rLlCifhXRJiT0RoN2FjK_Logo_roundbackground_black.png'
        image='https://media.giphy.com/media/IQF90tVlBIByw/giphy.gif'
      />
    </div>
  )
}

export default Feed
